import React from 'react';
import MainPage from "./MainPage.css"

function App() {
    const people = [
        { name: 'chris' },
        { name: 'nick' }
    ];

    return (
        <div className="MainPageDiv">
            <div className="ButtonDiv">
                <button onclick="addItem">
                    Add Item
                </button>
                <button onclick="deleteItem">
                    Delete Item
                </button>
            </div>
            <div className="ListDiv">
                {people.map(person => (
                    <p>{person.name}</p>
                ))}
            </div>
        </div>
    );
}

export default App;
